import { useState } from "react";

const Lifecycle = () => {
  const [count, setcount] = useState(0);
  const [text, settext] = useState("");
  return (
    <div style={{ padding: 20 }}>
      {count}
      <button
        onClick={() => {
          setcount(count + 1);
        }}
      >
        카운트 업
      </button>
      <button
        onClick={() => {
          setcount(count - 1);
        }}
      >
        카운트 다운
      </button>
      <div>
        <input
          value={text}
          onChange={(e) => {
            settext(e.target.value);
          }}
        />
      </div>
    </div>
  );
};

export default Lifecycle;
